import React from "react";
import GoogleLoginButton from "../components/GoogleLoginButton"

const LoginPage = () => {
  return (
    <div style={{ padding: "2rem" }}>
      <h2>Fitness Tracker Login</h2>
      <GoogleLoginButton />
    </div>
  );
};

export default LoginPage;
